import React from 'react'
import { Link } from 'react-router-dom'
import Slider from 'react-slick'
import { useAppSelector } from '../../../store/storeHooks'

const GalleryServicePageCard = () => {

    const serviceDetailsPage = useAppSelector((a) => a.serviceDetailsPageDetails)
    // console.log("serviceDetailsPage--->", serviceDetailsPage);


    return (
        <>


            {
                (serviceDetailsPage?.gallery) ? serviceDetailsPage?.gallery?.map((items, index) => {
                    return (
                        <div className='card-wrap'>
                            <div className="image-Box service-block">
                                <div>
                                    <Link to={`/service-detail/${serviceDetailsPage.serviceId}/${serviceDetailsPage.sellerData[0]?.firstName}`}>
                                        <div className="service-image" style={{ width: "200px" }}>
                                            <img
                                                src={serviceDetailsPage.path + items.media} alt="service" />
                                        </div>
                                    </Link>
                                    <div className="service-card">
                                        {/* <div className="service-name">{otherCardInfo.title}</div> */}
                                        <div className="service-name">{serviceDetailsPage.description}</div>
                                        {/* <div className="provider-info">{otherCardInfo.addressData[0]?.stateName}</div> */}
                                        {/* <div className="provider-info">{otherCardInfo.addressData[0]?.addressLine1}</div> */}
                                        {/* <div className="provider-info">$ </div> */}
                                        <div className="seller-rating">
                                            <div className="rating-wrap">
                                                {/* <div className="rating-number">Rating--{otherCardInfo.averageRating} </div> */}
                                            </div>
                                        </div>

                                    </div>
                                </div>
                            </div>
                        </div>
                    )
                }) : null
            }
        </>



    )
}

export default GalleryServicePageCard
